import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from "react-responsive-carousel";
import mobilityImage from "./img/mobility.png";
import shelterimage from "./img/shelter.png";
import foodImage from "./img/food.png";
import "";
export function StrategySlider() {
  return (
    <Carousel
      infiniteLoop
      showArrows={true}
      renderIndicator={(onClickHandler, isSelected, index, label) => {
        const defStyle = { marginLeft: 20, color: "white", cursor: "pointer" };
        const style = isSelected
          ? { ...defStyle, color: "black" }
          : { ...defStyle };
        return (
          <span
            style={style}
            onClick={onClickHandler}
            onKeyDown={onClickHandler}
            value={index}
            key={index}
            role="button"
            tabIndex={0}
            aria-label={`${label} ${index + 1}`}
          >
            {". " + index}
          </span>
        );
      }}
    >
      <div>
        <img src={mobilityImage} alt="" />
      </div>
      <div>
        <img src={shelterimage} alt="" />
      </div>
      <div>
        <img src={foodImage} alt="" />
      </div>
    </Carousel>
  );
}

